デントヘルス 薬用デンタルリンス 250ml<br>ブランド：デントヘルス<br>販売・製造元：ライオン<br><br>歯ぐきを守る薬用成分が直接浸透し、弱ってきた歯ぐきを活性化して歯槽膿漏を防ぐ液体はみがきです。<br>低刺激タイプ。<br>医薬部外品。<br>●歯ぐき活性化作用で歯ぐきを活性化し、歯ぐき組織を修復します。<br>●殺菌作用で原因菌を殺菌し、口臭を防ぎます。<br>●ダブル抗炎症作用で歯ぐきの腫れ・出血を防ぎます。<br> <br><br><br>使用方法<br>適量約10ml(計量コップ半分程度)をお口に含み、歯ぐきの気になる部分など、すみずみにいきわたるように20秒ほどよくすすいでください。<br>その後はき出し、歯や歯ぐきをブラッシング&マッサージしてください。<br>(水ですすいでも効果を発揮します。<br>) <br><br>使用上の注意<br>●アルコール配合製品。<br>●内服液ではありません。<br>●<br><br>使用方法<br>を守ってください。<br>●口中に異常があるときは使わないでください。<br>●発疹などの異常が現れたときは使用を中止し、商品を持参し、医師に相談してください。<br>●乳幼児の手の届くところには置かないでください。<br> <br>成分<br>●溶剤：エタノール●香味剤：香料(ペパーミントタイプ)、キシリトール●湿潤剤：PG、グリセリン●可溶化剤：POE硬化ヒマシ油、ラウリル硫酸Na●pH調整剤：クエン酸Na、クエン酸●薬用成分：グリチルリチン酸ジカリウム(GK2)、イソプロピルメチルフェノール(IPMP)、トラネキサム酸、アラントイン<br> 原産国：日本<br>効能・効果歯槽膿漏の予防、歯肉炎の予防、出血を防ぐ、口臭の防止、ムシ歯の発生及び進行の予防、口中を浄化する、口中を爽快にする <br>日用品／オーラルケア／歯磨き(ハミガキ)／液体歯磨き<br>JANコード： 4903301176657<br><br>CS：16<br>区分：医薬部外品<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
